import React from 'react';
import { connect } from 'react-redux';
//import ListItemReminder from './ListItemReminder';

function ListReminders(props) {
	return (
		props.reminderList.length !== 0 ?
		<div className="reminder-container">
			<ul className="reminder-list">
				{props.reminderList.map(reminder => {
					return (
						<div>
						  <li key={reminder.id}>{reminder.reminderText} </li>
						</div>
					)
					// return <ListItemReminder reminder={}/>
				})}
			</ul>
		</div> : null
	)
}

const mapStateToProps = state => ({
	reminderList: state.AddReminderReducer //need to change the name later
})

// const mapStateToProps = state => ({
//     todos: state.todos
// })

// const mapStateToProps = state => { 
//     return { todos: state.todos }; 
// };

export default connect(mapStateToProps, null)(ListReminders);
